import React, { Component } from 'react';
import Appbar from './Appbar';
import './Game.css'
import { PacmanLoader } from 'react-spinners'

export default class Game extends Component {
    constructor() {
        super();
        this.state = {
            loading: true
        }
    }

    render() {
        return (
            <div>
                <Appbar auth='true' logout={this.props.logout} />
                <div className='loading'><PacmanLoader color='yellow' css='margin-top:45%;margin-left:45%;' loading={this.state.loading}></PacmanLoader></div>

            </div>
        )
    }
}
